import React, { Component } from 'react';
import '../css/Layout.css';
import "antd/dist/antd.css";
import { Icon } from 'antd';
import {Nav , Navbar,Form,Button,FormControl,NavDropdown } from 'react-bootstrap';

class Layout extends Component {

    render() {

        return (
            <div>
                <Navbar bg="light" expand="lg">
                    <Navbar.Brand href="#home">
                        <img className="d-inline-block align-top" width="65px"
        height="70" src="https://res.cloudinary.com/aptech-fpt/image/upload/v1549933837/logo-nal.png"></img>
                    </Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="ml-auto">
                            <Nav.Link href="#home">Home</Nav.Link>
                            <Nav.Link href="#link">Link</Nav.Link>
                        </Nav>
                        <Form inline>
                            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                            <Button variant="outline-success">Search</Button>
                        </Form>
                    </Navbar.Collapse>
                </Navbar>
            </div>
        );
    }
}
export default Layout;
